import React from 'react';
import './TopFrame.scss'

var TopFrame = () => {
    return (
        <section className="top-frame">
            <div className="title">Vensangu Photography</div>
            <nav>
                <a  href="/">Home</a>
            </nav>
        </section>
    );
}

export default TopFrame;
